                <Typography variant="h3"  gutterBottom>
                    DR. BHARATH KUMAR B
                </Typography>
            </Row>
        </Col> */}
        <Row style={{alignItems:"center"}}>
            <Col>
            <Avatar alt="Dr. Bharath Kumar" className={classes.large} src={img} style={{top:"150px"}}/>
            </Col>
        </Row>
        <Row>
            <Col>
            <Typography variant="h3"  gutterBottom>
                    DR. BHARATH KUMAR B
                </Typography>
            </Col>
        </Row>


    </Container>    
  );
}

export default Home;
